import React from "react";

const Bottom=()=>{
    return(
        <>
            <div className="Container bg-dark text-white mt-2">
                <div className="row justify-content-center">
                    <div className="col-lg-6 col-md-8 col-sm-12">
                        <ul>
                            <li>About Us</li>
                            <li>Contact Us</li>
                            <li>Offers</li>
                            <li>Mobile App</li>
                        </ul>
                    </div>    
                </div>
            </div>
        </>
    );
}

export default Bottom;
